function Todo(props) {
  return (
    <div>
      <div className="bg-white rounded w-96 h-96 overflow-hidden drop-shadow-2xl">
        <h2 className="text-3xl p-6 px-32">{props.text}</h2>
        <div>
          <button className=" btn-del absolute bottom-0 right-0">Delete</button>
        </div>
      </div>
    </div>
  );
}

export default Todo;
